import re

def validate_strings(s1, s2):
    if len(s1) < 12 and len(s2) < 12:
        return False
    if len(re.findall('[!@#$%^&*(),.?":{}|<>]', s1)) < 3:
        return False
    if len(re.findall('[A-Z]', s2)) < 3:
        return False
    if re.search('(.)\\1', s1) or re.search('(.)\\1', s2):
        return False
    if len(s1) + len(s2) > 25:
        return False
    if len(re.findall('[a-z]', s1)) < 2:
        return False
    if len(re.findall('\\d', s2)) < 2:
        return False
    if len(re.findall('\\s', s1)) < 2 or len(re.findall('\\s', s2)) < 2:
        return False
    if not re.match('^[a-zA-Z]', s1):
        return False
    if not re.match('^[a-zA-Z]$', s2[-1]):
        return False
    return True

